properties.css:
@import url('https://fonts.googleapis.com/css?family=Montserrat&display=swap');

*{
    font-family: 'Montserrat', sans-serif;
}

body .form .form-row > label, body #form-canvas .form-cell .label, body #form-canvas .subform-cell .label{
    text-align: left;
    max-width:200px;
}

.mCustomScrollBox {
    background-image: url(/jw/web/app/ots/resources/side-bar-image.png);
    background-size: 100%;
    background-repeat: no-repeat;
    background-position-y: bottom;
}


.left-nav #nav li .nav_right{
    float: none;
    position: absolute;
    right: 12px;
}

/* Welcome page white background size adjustment*/
body#welcome:not(#login) #content > main > .ui-html{
    height: 530px;
}

.body .form fieldset.has-legend legend, body #form-canvas .form-section-title span, body #form-canvas .subform-section-title span {
    background-color:#efeefe;
}

.form-cell-value label, .subform-cell-value label{
    position: absolute;
    left: 0;
    width: 130%;
    float: none;
}

body #form-canvas .form-column, body #form-canvas .subform-column{
    max-width: 100%;
}

body #form-canvas #section-actions{
    padding-left: 45%;
}

/* Size of the text field got small */
.form-column{
    width: 100%  !important;
}

/* The the blue warning at last part of form */
body #form-canvas .customHtml.no_label .form-cell-value, body #form-canvas .customHtml.no_label .subform-cell-value{
    width: 70%;
}
